	return (
		<Router>
			<div>
				<nav style={{ textAlign: "center", margin: 24 }}>
					<Link to="/" style={{ marginRight: 24, fontWeight: 600, textDecoration: "none", color: "#1976d2" }}>
						Trang chá»§
					</Link>
				</nav>
				<Routes>
					<Route path="/" element={<Home />} />
					<Route path="/donate/:projectId" element={<Donate />} />
				</Routes>
			</div>
		</Router>
	);
}

export default App;
